webpackJsonp([0xf6bc43e87cdd],{4266:function(a,n){a.exports={data:{markdownRemark:{html:'<p>今回の夏コミは、<em>日曜日 東Q-24aにて無事当選</em>いたしました！ ˶ ＞◡＜ ˶ 早速ですが、頒布物など告知させていただきます！</p>\n<h2>[[新刊ゲーム] MATH.SC (仮称)</h2>\n<p>](<a href="http://math.sc/">http://math.sc/</a>) プレ・アルファ体験版 <del>100円</del>→無料！ <em>今回は完成度の都合上、無料で頒布いたします！</em> 今回の新刊はオリジナルの、新感覚賢くなるクイズ＆カードバトルゲームです。 Windows 用 (Vista SP2以降必須) です。現在鋭意製作中、進展があり次第随時<a href="http://math.sc/">特設ページ</a>にてご案内いたします！  新刊はそれなりにヤケクソな量持っていくつもりなので、大手さんをゆっくり回ってから来ていただけると幸いです。 ただし、<em>当日は諸事情につき、13時過ぎに撤収します</em>ので、それまでにどうぞ。</p>\n<h2>[[既刊ゲーム] 結界幻想録 鏡 - mythical mirror</h2>\n<p>](<a href="http://kagaminer.in/">http://kagaminer.in/</a>) 1,000円  ※プレイヤーさんのリプレイです。 <a href="http://dangoya.moo.jp/">DANGOYA</a> さんとの合作、東方の世界観を使った縦型弾幕 STG です。チルノや諏訪子などおなじみのキャラが幻想郷のようで幻想郷でない、謎めいた世界に迷い込んでしまったが、そんなこともお構いなしに大暴れ！オリキャラも登場します！ Windows 用 (XP SP3以降必須) です。</p>\n<h2>[[既刊ラノベ] EVIL MAGIC ～ 邪の魔術</h2>\n<p>](/evilmagic) <del>800円</del>→500円 (コミケ特別価格) <img src="https://danmaq.com/wp-content/uploads/2012/11/em_POP.png" alt="特設ページ"> 180 ページの本格ファンタジーなライトノベルです。不思議な能力が使える女の子エナと、弟と幼馴染の悪ガキトリオが大暴れ！しかしもっと悪いヤツ、領主は幼馴染の男の子を攫ってしまった！事を知って怒髪天なエナは領主に勝負に挑むが……！？ <a href="/filez/em_trial.pdf">気になる方は冒頭 69 ページだけ読める体験版をどうぞ！</a> (4MB | PDF 注意)</p>\n<h2>[[既刊音楽CD] danmaq soundtrack</h2>\n<p>](/!/dst/) 100円 <img src="https://danmaq.com/wp-content/uploads/2012/11/dst_jacket.png" alt="特設ページ"> 30 曲、75 分の大ボリューム！ danmaq が 1999 年から 2007 年までに作った楽曲の<em>アウトテイク集</em>です。東方をメインに BEMANI アレンジやオリジナルも多数収録。ボカロもほんのちょっ……とだけ収録！</p>\n<ul>\n<li>\n<p><a href="/!/dst/Hey!.mp3">こんな</a></p>\n</li>\n<li>\n<p><a href="/filez/music/new_psm.mp3">曲とかが</a></p>\n</li>\n<li>\n<p><a href="/filez/music/pcb.mp3">たくさん</a></p>\n</li>\n<li>\n<p><a href="http://lama.danmaq.com/lamarisa/mp3/15.mp3">収録されてます！</a>\n<strong>[[既刊音楽CD] Leila Prismriver</strong>](/!/leila/) <del>300円</del>→100円 (コミケ特別価格) <img src="https://danmaq.com/wp-content/uploads/2012/11/leila1-300x296.jpg" alt="特設ページ"> 13 曲 64 分の東方アレンジ音楽 CD です。秘封倶楽部な楽曲を中心に、シンセサイザ KORG OASYS でリミックスしてみました！</p>\n</li>\n<li>\n<p><a href="/!/leila/x.mp3">全曲クロスフェード デモを聴く</a> (7:11 | 8MB)\nなお、上記の告知は<em>すべて予定</em>です。当日までに頒布物が追加・変更になる可能性がありますのでご了承ください。 ※夢終劇 DX PACK の夏の再頒布は、予算の都合上厳しいです＞＜ごめんなさい！</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2015-06-15T02:25:22+09:00",strDate:"2015/6/14",title:"コミックマーケット88出展情報"}}},pathContext:{path:"/ja/blog/2015/06/15-c88/",langKey:"ja"}}}});
